                <div>
                    <video autoPlay muted loop className={S.myVideo} >
                        {/*<source src="https://apextest12.b-cdn.net/TRIAL____________Pexels%20Videos%202098989.mp4" type="video/mp4"/>*/}
                        <source src={video2} type="video/mp4"/>
